google_stackdriver_logging:
- description: Number of bytes in all log entries ingested.
  interval: ""
  metric_name: gcp.logging.byte_count
  metric_type: count
  per_unit_name: ""
  unit_name: byte
- description: Number of log entries that did not contribute to user defined metrics.
  interval: ""
  metric_name: gcp.logging.dropped_log_entry_count
  metric_type: count
  per_unit_name: ""
  unit_name: entry
- description: Number of log entries that contributed to user-defined metrics.
  interval: ""
  metric_name: gcp.logging.log_entry_count
  metric_type: count
  per_unit_name: ""
  unit_name: entry
